import React, { Component } from 'react';
import Header from '../components/Header';
import Meta from './Meta';
import styled from 'styled-components';



// const Inner = styled.div`
    
// `


class Page extends Component {
    render() {
        return (
            <StyledPage>
                <Meta />
                <Header />
                {this.props.children}
            </StyledPage>
        )
    }
}

export default Page;
